import { makeStyles, createStyles } from "@material-ui/styles";

const useStyles = makeStyles((theme) => createStyles({
  root: {
    position: "relative",
    height: "100%"
  },
  tabs: {
    position: "absolute",
    width: "100%"
  },
  indicator: {
    height: 50
  }

}));

export default useStyles;
